    const [defSize, setDefSize] = useState({}) // key : type
    const [delSize, setDelSize] = useState({}) // key : type

    return (
        <div className="frame">
            <div>
                <table>
                    <tr>
                        <th>사이즈</th>
                        {types.map((v) => {return <th>{v}</th>})}
                        <button>추가</button>
                    </tr>
                    {sizes.map((v) => {return (
                        <tr>
